package net.rk.thingamajigs.render;

import com.mojang.blaze3d.vertex.PoseStack;
import net.minecraft.client.Minecraft;
import net.minecraft.client.renderer.MultiBufferSource;
import net.minecraft.client.renderer.blockentity.BlockEntityRenderer;
import net.minecraft.client.renderer.blockentity.BlockEntityRendererProvider;
import net.minecraft.client.renderer.texture.OverlayTexture;
import net.minecraft.core.BlockPos;
import net.minecraft.world.phys.AABB;
import net.minecraft.world.phys.Vec3;
import net.neoforged.neoforge.client.model.data.ModelData;
import net.rk.thingamajigs.block.TBlocks;
import net.rk.thingamajigs.blockentity.custom.CeilingFanBE;
import org.joml.Quaternionf;

public class CeilingFanBERenderer implements BlockEntityRenderer<CeilingFanBE>{
    @Override
    public void render(CeilingFanBE be, float parttick, PoseStack ps, MultiBufferSource mbs, int light, int overlay) {
        if(!be.hidePose){
            ps.pushPose();
            ps.mulPose(new Quaternionf().rotationY(be.rotation * (float) (Math.PI / 270.0)));

            ps.translate(0.0, 0.0, 0.0);

            Minecraft.getInstance().getBlockRenderer().renderSingleBlock(TBlocks.CEILING_FAN_BLADES.get().defaultBlockState(),
                    ps,mbs,light, OverlayTexture.NO_OVERLAY,
                    ModelData.EMPTY,null);

            ps.popPose();
        }
    }

    public CeilingFanBERenderer(BlockEntityRendererProvider.Context berpContext) {}
    @Override
    public int getViewDistance() {
        return 128;
    }

    @Override
    public boolean shouldRender(CeilingFanBE be, Vec3 vec3) {
        return Vec3.atCenterOf(be.getBlockPos()).multiply(1.0, 0.0, 1.0)
                .closerThan(vec3.multiply(1.0, 0.0, 1.0), (double)this.getViewDistance());
    }

    @Override
    public boolean shouldRenderOffScreen(CeilingFanBE be) {
        return true;
    }

    @Override
    public AABB getRenderBoundingBox(CeilingFanBE be) {
        BlockPos bp = be.getBlockPos();
        return new AABB(bp.getX(),bp.getY() - getViewDistance(),bp.getZ(),bp.getX(),bp.getY() + getViewDistance(),bp.getZ());
    }
}

