// Path: /app/Http/Controllers/Admin/System/AddonController.php

namespace App\Http\Controllers\Admin\System;

use App\Http\Controllers\Controller;
use Illuminate\Http\Request;
use Validator;
use File;
use Exception;
use ZipArchive;
use Illuminate\Support\Str;
use App\Models\Addon;

class AddonController extends Controller
{
    /**
     * Uploads and installs an addon.
     *
     * @param \Illuminate\Http\Request $request
     * @return \Illuminate\Http\RedirectResponse
     */
    public function upload(Request $request)
    {
        // Validate the request for addon_files input as a required zip file
        $validator = Validator::make($request->all(), [
            'addon_files' => ['required', 'mimes:zip'],
        ]);

        // If validation fails, display errors and return back with input
        if ($validator->fails()) {
            foreach ($validator->errors()->all() as $error) {
                toastr()->error($error);
            }
            return back()->withInput();
        }

        // Check if ZipArchive class exists
        if (!class_exists('ZipArchive')) {
            toastr()->error(translate('ZipArchive extension is not enabled'));
            return back();
        }

        try {
            // Upload the addon zip file to a temporary location
            $addonZipFile = storageFileUpload($request->file('addon_files'), 'temp/', 'local');
            $addonUploadPath = storage_path("app/{$addonZipFile}");

            // Create a temporary folder to extract the addon files
            $tempFolder = md5(Str::random(10) . time());
            $addonTempPath = storage_path("app/temp/{$tempFolder}");

            // If the temp folder already exists, remove it
            if (File::exists($addonTempPath)) {
                removeDirectory($addonTempPath);
            }
        } catch (Exception $e) {
            // Handle any exceptions during file upload
            toastr()->error($e->getMessage());
            return back();
        }

        try {
            // Initialize ZipArchive and open the uploaded zip file
            $zip = new ZipArchive;
            $res = $zip->open($addonUploadPath, ZipArchive::CREATE);
            if ($res !== true) {
                throw new Exception(translate('Could not open the addon zip file'));
            }

            // Extract the zip file to the temporary path
            $res = $zip->extractTo($addonTempPath);
            if ($res === true) {
                removeFile($addonUploadPath); // Remove the uploaded zip file after extraction
            }
            $zip->close();

            // Check if the config.json file exists in the extracted files
            $configFile = "{$addonTempPath}/config.json";
            if (!File::exists($configFile)) {
                throw new Exception(translate('Addon Config is missing'));
            }

            // Parse the config.json file
            $config = json_decode(File::get($configFile), true);

            // Validate the type of addon
            if ($config['type'] !== "addon") {
                throw new Exception(translate('Invalid addon files'));
            }

            // Skipping purchase code validation

            // Validate the script alias and version
            $scriptAlias = $config['script']['alias'];
            $scriptVersion = $config['script']['version'];

            if (strtolower(config('system.item.alias')) != strtolower($scriptAlias)) {
                throw new Exception(translate('Invalid action request'));
            }

            if (config('system.item.version') < $scriptVersion) {
                throw new Exception(translate("The :addon_name addon requires :script_name version :script_version or above", [
                    'addon_name' => $config['name'],
                    'script_name' => $scriptAlias,
                    'script_version' => $scriptVersion,
                ]));
            }

            // Define the destination path for the addon
            $addonDestinationPath = base_path($config['path']);
            if (File::exists($addonDestinationPath)) {
                removeDirectory($addonDestinationPath);
            }

            // Move the extracted addon files to the destination path
            File::move($addonTempPath, $addonDestinationPath);

            // Install the addon files
            $this->installAddonFiles($addonDestinationPath);

            // Update or create the addon record in the database
            $addon = Addon::updateOrCreate(['alias' => $config['alias']], [
                'name' => $config['name'],
                'version' => $config['version'],
                'thumbnail' => $config['thumbnail'],
                'path' => $config['path'],
                'action' => $config['action'],
                'status' => $config['status'],
            ]);

            // If addon is successfully installed, clean up and display success message
            if ($addon) {
                removeDirectory($addonTempPath);
                toastr()->success(translate('The addon has been installed successfully'));
                return back();
            }
        } catch (Exception $e) {
            // Handle any exceptions during addon installation
            removeFile($addonUploadPath);
            removeDirectory($addonTempPath);
            toastr()->error($e->getMessage());
            return back();
        }
    }

    // Placeholder for the installAddonFiles method
    private function installAddonFiles($path)
    {
        // Implement the logic to install addon files if necessary
    }
}

