#define  upButtonPin A0
#define  downButtonPin A1
#define  jel12VPin A3

const int numRelays = 5; // Rel√©k sz√°ma
int relayPins[numRelays] = {5, 6, 7, 8, 9}; // Rel√©k csatlakoztat√°si pinjei
bool buttonUpState = LOW;   // A nyom√≥gomb aktu√°lis √°llapota
bool buttonDownState = LOW;   // A nyom√≥gomb aktu√°lis √°llapota
bool jel12VState = LOW;   // A 12V-os jel aktu√°lis √°llapota
bool lastButtonUpState = LOW; // Az el≈ëz≈ë nyom√≥gomb √°llapot
bool lastButtonDownState = LOW; // Az el≈ëz≈ë nyom√≥gomb √°llapot
bool lastJel12VState = LOW; // A 12V-os jel el≈ëz≈ë √°llapota
int level=1;   // A v√°ltoztatni k√≠v√°nt fokozat kezdeti √©rt√©ke 1
int lastLevel=1;   // A v√°ltoztatni k√≠v√°nt fokozat el≈ëz≈ë √©rt√©ke 1
unsigned long lastDebounceTimeUp = 0;  // A fel nyom√≥gomb utols√≥ prellmentes id≈ëpontja
unsigned long lastDebounceTimeDown = 0;  // A le nyom√≥gomb utols√≥ prellmentes id≈ëpontja
unsigned long debounceDelay = 50;    // A prellmentes id≈ë be√°ll√≠t√°sa


void setup() {
  //Serial.begin(115200);         // Soros kommunik√°ci√≥ inicializ√°l√°sa
  //Serial.println("Start ...");  // L√°ssuk, hogy rendben elindult a program
  for (int i = 0; i < numRelays; i++) {
    pinMode(relayPins[i], OUTPUT);
    digitalWrite(relayPins[i],LOW);
  }
  pinMode(upButtonPin, INPUT_PULLUP);
  pinMode(downButtonPin, INPUT_PULLUP);
  pinMode(jel12VPin, INPUT_PULLUP);
  pinMode(13,OUTPUT);
}

void loop() {
  int readingUp = !digitalRead(upButtonPin); // Olvassuk be a fel nyom√≥gomb √°llapot√°t neg√°lva, ha a GND-ra van csatlakoztatva
  int readingDown = !digitalRead(downButtonPin); // Olvassuk be a le nyom√≥gomb √°llapot√°t neg√°lva, ha a GND-ra van csatlakoztatva
  // Amennyiben a +t√°phoz csatlakoztattuk, akkor √≠gy m√≥dosul a nyom√≥gombok √°llapot√°nak a beolvas√°sa:
  //int readingUp = digitalRead(upButtonPin); // Olvassuk be a fel nyom√≥gomb √°llapot√°t
  //int readingDown = digitalRead(downButtonPin); // Olvassuk be a le nyom√≥gomb √°llapot√°t
  int readingJel12V = !digitalRead(jel12VPin); // Olvassuk be a 12V jel √°llapot√°t
  digitalWrite(13,readingJel12V);
  if (lastJel12VState != readingJel12V){    // Ha a 12V-os jel √°llapota v√°ltozott
    if (readingJel12V==LOW){    // Nincs 12V-os jel, kikapcsol az √∂sszes rel√©
      for (int i = 0; i < numRelays; i++) {
        digitalWrite(relayPins[i],LOW);
      }
    } else {    // Megvan a 12V-os jel
      level=1;
      lastLevel=1;
      digitalWrite(relayPins[level-1],HIGH);     // Az 1. rel√© bekapcsol√°sa
    }
  }
  // Ha a fel gomb √°llapota v√°ltozott 
  if (readingUp != lastButtonUpState) {
    // Friss√≠tj√ºk a prellmentes id≈ëtartam kezdeti idej√©t
    lastDebounceTimeUp = millis();
  }
  // Ha a le gomb √°llapota v√°ltozott √©s megvan a 12V-os jel
  if (readingDown != lastButtonDownState) {
    // Friss√≠tj√ºk a prellmentes id≈ëtartam kezdeti idej√©t
    lastDebounceTimeDown = millis();
  }
  // Ellen≈ërizz√ºk, hogy a fel gomb √°llapota stabil-e a prellmentes id≈ë ut√°n
  if ((millis() - lastDebounceTimeUp) > debounceDelay) {
    // Ha igen, akkor friss√≠tj√ºk a gomb √°llapot√°t
    if (readingUp != buttonUpState) {
      buttonUpState = readingUp;
      // Ha a gombot lenyomtad
      if (buttonUpState == HIGH and readingJel12V==HIGH) {
        level++;    // Fokozat sz√°m√°nak n√∂vel√©se
        if (level>numRelays) {    // Ha a fokozat sz√°ma nagyobb, mint a maximum, akkor a fokozat sz√°ma a maximum lesz
          level=numRelays;
        } else {    // T√∂rt√©nt v√°ltoz√°s a fokozat sz√°m√°ban
          digitalWrite(relayPins[lastLevel-1],LOW);  // Az el≈ëz≈ë √°llapot kikapcsol√°sa
          digitalWrite(relayPins[level-1],HIGH);     // Az √∫j √°llapot bekapcsol√°sa
          lastLevel=level;    // A v√°lt√≥ aktu√°lis √°llapot√°t elt√°roljuk az el≈ëz≈ë √°llapotban
        }
      } 
      // Ha a gombot elengedted
      else {
        //Serial.println("A fel nyom√≥gomb elengedve");
      }
    }
  }

  // Ellen≈ërizz√ºk, hogy a le gomb √°llapota stabil-e a prellmentes id≈ë ut√°n
  if ((millis() - lastDebounceTimeDown) > debounceDelay) {
    // Ha igen, akkor friss√≠tj√ºk a gomb √°llapot√°t
    if (readingDown != buttonDownState) {
      buttonDownState = readingDown;
      // Ha a gombot lenyomtad
      if (buttonDownState == HIGH and readingJel12V==HIGH) {
        level--;    // Fokozat sz√°m√°nak n√∂vel√©se
        if (level<1) {    // Ha a fokozat sz√°ma kisebb, mint a minimum, akkor a fokozat sz√°ma a minimum lesz
          level=1;
        } else {    // T√∂rt√©nt v√°ltoz√°s a fokozat sz√°m√°ban
          digitalWrite(relayPins[lastLevel-1],LOW);  // Az el≈ëz≈ë √°llapot kikapcsol√°sa
          digitalWrite(relayPins[level-1],HIGH);     // Az √∫j √°llapot bekapcsol√°sa
          lastLevel=level;    // A v√°lt√≥ aktu√°lis √°llapot√°t elt√°roljuk az el≈ëz≈ë √°llapotban
        }
      } 
      // Ha a gombot elengedted
      else {
        //Serial.println("A le nyom√≥gomb elengedve");
      }
    }
  }
  // A fel √©s a le nyom√≥gomb aktu√°lis √°llapot√°t elt√°roljuk az el≈ëz≈ë √°llapotban
  lastButtonUpState = readingUp;
  lastButtonDownState = readingDown;
  lastJel12VState = readingJel12V;
}

