using namespace std;

class Node
{
public:
    int val;
    Node *next;
    Node *prev;

    Node(int val)
    {
        this->val = val;
        this->next = NULL;
        this->prev = NULL;
    }
};

void print_normal(Node *head)
{
    // cout << "start of print_normal\n";
    Node *tmp = head;

    while (tmp != NULL)
    {
        // cout << "start of while loop of print_normal\n";
        cout << tmp->val << " ";
        tmp = tmp->next;
    }
    cout << endl;
    // cout << "end of print_normal\n";
}

void print_reverse(Node *tail)
{
    // cout << "start of print_reverse\n";
    Node *tmp = tail;

    while (tmp != NULL)
    {
        cout << tmp->val << " ";
        tmp = tmp->prev;
    }

    cout << endl;
    // cout << "end of print_reverse\n";
}

void insert_tail(Node *&head, Node *&tail, int val)
{
    // cout << "start of insert_tail\n";
    Node *newNode = new Node(val);

    // if (tail == NULL)
    if (head == NULL)
    {
        head = newNode;
        tail = newNode;
        return;
    }

    tail->next = newNode;
    newNode->prev = tail;
    // tail = tail->next;
    tail = newNode;
    // cout << "end of insert_tail\n";
}

int main()
{
    Node *head = NULL;
    Node *tail = NULL;

    /*
    The val variable is declared in a wrong place.
     It has scope maintaining problem.
     */
    // int val;

    while (true)
    {
        int val; // right place to declare the val variable
        cin >> val;
        // cout << "Check the value of <<<val>>>" << val << endl;
        if (val == -1)
        {
            break;

            // wrong place to invoke the insert_tail function
            // insert_tail(head, tail, val); 
        }
        // right place to invoke the insert_tail function
        insert_tail(head, tail, val);
        // cout << "Inside the while loop\n";
    }
    // cout << "After the while loop\n";

    print_normal(head);
    print_reverse(tail);

    return 0;
}

